import React from "react";
import styled from "styled-components";

function Object2() {
  return <ObjectTwo />;
}

export default Object2;

const ObjectTwo = styled.div`
  position: absolute;
  width: 137.1px;
  height: 213px;
  left: 773.13px;
  top: 103px;
  background-color: #c4c4c4;
  border: 5px solid #000000;
  box-sizing: border-box;
  transform: rotate(15deg);
`;
